function getKeywords(text) {
    const regex = /\b\w+\b/g;
    const words = text.match(regex);
    const keywordArray = [];
    for (let word of words) {
        if (!keywordArray.includes(word)) {
            keywordArray.push(word);
        }
    }
    return keywordArray;
}

// Define a function to generate JSON objects with high-level and low-level keywords
function generateJson() {
    const trueFalseQuestions = [
        { question: "NS is easy", correct_answer: false },
        { question: "AS is difficult", correct_answer: true },
        // Add more questions as needed...
    ];

    return trueFalseQuestions.reduce((acc, curr) => {
        acc["high_level_keywords"] = getKeywords(curr.question);
        acc["low_level_keywords"] = getKeywords(curr.correctAnswer ? curr.question : curr.question.toUpperCase());
        return acc;
    }, {});
}

